import React, { Component } from "react";
import { Link } from "react-router-dom";



export class Products extends Component {
    constructor() {
      super();
      this.state = {
        Products: [
          {
            SKU:1,
            name:'disco',
          },
          {
            SKU:2,
            name:'batata',
          },
          {
            SKU:3,
            name:'tomate',
          },
          {
            SKU:4,
            name:'stuff',
          },
          {
            SKU:5,
            name:'idk',
          },
        ]
      };
    }
   
    productData = () => {
      let products = this.state.Products;
       products.map((product)=>{
         <div>
           <h1>{product.name}</h1>
         </div>
        
      })
      
    };
  
    render() {
      return (
        <div className="App">
          <header>
            <h1>Product List</h1>   
                  <button id="add-product-btn" onClick={this.productData}>Add Product</button>
                  <button id="delete-product-btn">Delete Product</button>
                  <Link to ='/add'>Add</Link>
                  <hr />
          </header>
          <div>
              {
           products.map((product)=>{
         <div>
           <h1>{product.name}</h1>
         </div>
        
      })}
          </div>

          
         
        </div>
      );
    }
  }
